.list-radio {
  border: 1px solid #e6e6e6;
  border-radius: 4px;
  padding-left: 20px;

  &__main--lever {
    display: flex;
    list-style: none;
    padding: 0;
    text-align: right;

    .el-radio__inner {
      border: 2px solid #c8c8c9;
    }

    &-header {
      width: 70px;
      text-align: right;
      padding-right: 5px;
    }

    &-wrapper {
      padding-left: 100px;
      display: flex;
      list-style: none;
    }

    &-item {
      width: 70px;

      .el-radio__inner::after {
        width: 7px;
        height: 7px;
      }

      .el-radio__inner {
        width: 20px;
        height: 20px;
      }

      .is-disabled {
        .el-radio__inner {
          background-color: #e6e7e8;
          border-color: #c5c5c5;
        }
      }

      .el-radio__label {
        display: none;
      }
    }
  }

  .list-subject-content_name {
    color: #00adff;
    font-weight: 700;
    width: 100px;
    display: block;
  }

  .list-subject-content {
    display: flex;
    align-items: center;
  }
}
